import Colors from '../constants/colors';
import styled from 'styled-components';


export default class index extends React.Component {

    static async getInitialProps() {
        return {}
    }

    render() {
        return (
            <div className="mainContainer">
                <NavBar>
                    <Logo>HOMINIAN</Logo>

                    <PageLinks>
                        <div className="logo">PRODUCTS</div>
                        <div className="logo">BLOG</div>
                    </PageLinks>
                </NavBar>


                <style jsx>
                    {`
                        .mainContainer{
                            height: 200vh;
                            width: 100%;
                            background: white;
                        }                    
                     
                  `}
                </style>

                <style global jsx>
                    {`
                        body {
                            background:white;
                            margin: 0;
                            padding: 0;
                            border: 0;
                        }
                       
                    `}
                </style>

            </div>
        )

    }



}


const NavBar = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    width: 100%;
    background: coral;
`
const Logo = styled.div`
    font-size: 2em;
    padding: 32px;
`
const PageLinks = styled.div`
    display: flex;
    flex-direction: row;
    padding: 32px;
    justify-content: spa
`
